import qupath.lib.color.ColorDeconvolutionStains
import qupath.lib.color.StainVector

//ADJUST SETTINGS HERE//////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////

String objectClassifierPath = ""; // Put your (optional) object classifier file location inside the parentheses (including quotes)
String pixelClassifierPath = ""; // Put your (optional) pixel classifier file location inside the parentheses (including quotes), for tissue detection
List<Double> smoothing = [25, 50]; // Put the smoothing values inside the brackets, separated by a comma
boolean autoGenerateROI = false; // Edit to "true" or "false" depending if you want to autogenerate the ROI

////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////
// set Pixel Size
setPixelSizeMicrons(getCurrentImageData(), 0.2500, 0.2500, 1)

// Set stain vectors to target values for the image
double[] hematoxylinRGB = [0.651, 0.701, 0.29];
double[] eosinRGB = [0.216, 0.801, 0.558];
double[] backgroundRGB = [255, 255, 255];
StainVector customHematoxylin = StainVector.createStainVector("Hematoxylin", hematoxylinRGB[0], hematoxylinRGB[1], hematoxylinRGB[2]);
StainVector customEosin = StainVector.createStainVector("Eosin", eosinRGB[0], eosinRGB[1], eosinRGB[2]);
ColorDeconvolutionStains cdsOutput = new ColorDeconvolutionStains("CustomCDS", customHematoxylin, customEosin, backgroundRGB[0], backgroundRGB[1], backgroundRGB[2]);     
getCurrentImageData().setColorDeconvolutionStains(cdsOutput);

clearDetections(); // clear all preexisting detections
selectAnnotations(); // create annotations

def imageData = getCurrentImageData();
println(imageData);
def server = imageData.getServer();
def pixelSize = server.getPixelCalibration().getPixelHeightMicrons();

hierarchy = getCurrentHierarchy();

if (autoGenerateROI){

    List<PathObject> annotationsToRemove = getAnnotationObjects().findAll{it.getPathClass() != getPathClass("Ignore*")}
    removeObjects(annotationsToRemove, false);

    int z = 0;
    int t = 0;
    def plane = ImagePlane.getPlane(z, t);
    def roi = ROIs.createRectangleROI(0, 0, server.getWidth(),server.getHeight(), plane);
    PathObject annotation = PathObjects.createAnnotationObject(roi);
    addObject(annotation);

    List<PathObject> ignoreAnnotations = getAnnotationObjects().findAll {it.getPathClass() == getPathClass("Ignore*")}
    mergeAnnotations(ignoreAnnotations);
    PathObject ignoreAnnotation = getAnnotationObjects().findAll {it.getPathClass() == getPathClass("Ignore*")}[0]

    try {
        annotation = subtractAnnotations(annotation, ignoreAnnotation);
    } catch (GroovyRuntimeException | NullPointerException e) {
        println(e);
        return;
    }

    selectObjects(annotation);
    runPlugin('qupath.imagej.detect.cells.WatershedCellDetection', '{"detectionImageBrightfield": "Hematoxylin OD",  "requestedPixelSizeMicrons": 0.5,  "backgroundRadiusMicrons": 8.0,  "medianRadiusMicrons": 0.0,  "sigmaMicrons": 1.5,  "minAreaMicrons": 10.0,  "maxAreaMicrons": 400.0,  "threshold": 0.1,  "maxBackground": 2.0,  "watershedPostProcess": true,  "cellExpansionMicrons": 5.0,  "includeNuclei": true,  "smoothBoundaries": false,  "makeMeasurements": true}');
    for (double smoothingValue : smoothing){
        runPlugin('qupath.lib.plugins.objects.SmoothFeaturesPlugin', '{"fwhmMicrons": ' + smoothingValue + ',  "smoothWithinClasses": false}');
    }
    runObjectClassifier(objectClassifierPath);

    List<PathObject> tumorDetections = getDetectionObjects().findAll { it.getPathClass() == getPathClass("Tumor")}
    List tumorGeometries = tumorDetections.collect { it.getROI().getGeometry().getCentroid()}

    println("Unionizing tumor cell geometries...");
    def tumorUnion = GeometryTools.union(tumorGeometries);
    def tumorROI = GeometryTools.geometryToROI(tumorUnion, plane);
    def roiDilated;

    for (int i = 0; i < 6; i++){ // incremental buffering is important; otherwise can be computationally taxing

        if (i == 5){
            println("Dilating ${i+1} of 7...");     
            roiDilated = RoiTools.buffer(tumorROI, 30*(1/pixelSize));
            tumorROI = GeometryTools.geometryToROI(roiDilated.getGeometry().buffer(0), plane);
            break;
        }

        println("Dilating ${i+1} of 7...");
        roiDilated = RoiTools.buffer(tumorROI, 7*(1/pixelSize));
        tumorROI = GeometryTools.geometryToROI(roiDilated.getGeometry().buffer(0), plane);

    }

    PathObject intermediate = PathObjects.createAnnotationObject(roiDilated);
    addObject(intermediate);
    intermediate.setPathClass(getPathClass("Intermediate"));
    removeObject(annotation, false);
    selectObjects(intermediate);
    runPlugin('qupath.lib.plugins.objects.SplitAnnotationsPlugin', '{}');

    List<PathObject> toRemove = getAnnotationObjects().findAll { it.getPathClass() == getPathClass("Intermediate") && it.getROI().getArea() < 20000/(pixelSize*pixelSize)}
    removeObjects(toRemove, false);
    mergeAnnotations(getAnnotationObjects().findAll { it.getPathClass() == getPathClass("Intermediate")});
    intermediate = getAnnotationObjects().findAll { it.getPathClass() == getPathClass("Intermediate")}[0]

    println("Dilating 7 of 7...");
    def intermediateROI = GeometryTools.geometryToROI(intermediate.getROI().getGeometry().buffer(0), plane);
    roiDilated = RoiTools.buffer(intermediate.getROI(), 435*(1/pixelSize));
    PathObject finished = PathObjects.createAnnotationObject(roiDilated);
    addObject(finished);
    removeObject(intermediate, false);
    deselectAll();

    // return;

}

List<PathObject> roiAnnotations = [];
List<PathObject> ignoreAnnotations = [];
getAnnotationObjects().forEach( annotation -> {

    if (annotation.getPathClass() == getPathClass("Ignore*")){
        ignoreAnnotations << annotation;
    } else {
        annotation.setPathClass(getPathClass("Temp"));
        roiAnnotations << annotation;
    }

});

mergeAnnotations(roiAnnotations);
mergeAnnotations(ignoreAnnotations);

PathObject roiAnnotation;
PathObject ignoreAnnotation;
getAnnotationObjects().forEach( annotation -> {

    if (annotation.getPathClass() == getPathClass("Ignore*")){
        ignoreAnnotation = annotation;
    } else {
        roiAnnotation = annotation;
    }

});

double roiAnnotationArea;
try {
    roiAnnotation = subtractAnnotations(roiAnnotation, ignoreAnnotation);
    roiAnnotation = wrapAnnotation(roiAnnotation, pixelClassifierPath);
    roiAnnotationArea = roiAnnotation.getROI().getArea();
} catch (GroovyRuntimeException | NullPointerException e) { // happens when roiAnnotation is absent
    println(e);
    return;
}

selectObjects(roiAnnotation);
runPlugin('qupath.imagej.detect.cells.WatershedCellDetection', '{"detectionImageBrightfield": "Hematoxylin OD",  "requestedPixelSizeMicrons": 0.5,  "backgroundRadiusMicrons": 8.0,  "medianRadiusMicrons": 0.0,  "sigmaMicrons": 1.5,  "minAreaMicrons": 10.0,  "maxAreaMicrons": 400.0,  "threshold": 0.1,  "maxBackground": 2.0,  "watershedPostProcess": true,  "cellExpansionMicrons": 5.0,  "includeNuclei": true,  "smoothBoundaries": false,  "makeMeasurements": true}');
for (double smoothingValue : smoothing){
    runPlugin('qupath.lib.plugins.objects.SmoothFeaturesPlugin', '{"fwhmMicrons": ' + smoothingValue + ',  "smoothWithinClasses": false}');
}
runObjectClassifier(objectClassifierPath);

Map immunePathClass = [pathClass: getPathClass("Immune cells"), count: 0, area: 0.0];
Map otherPathClass = [pathClass: getPathClass("Other"), count: 0, area: 0.0];
Map stromaPathClass = [pathClass: getPathClass("Stroma"), count: 0, area: 0.0];
Map tumorPathClass = [pathClass: getPathClass("Tumor"), count: 0, area: 0.0];
List<Map> pathClassList = [immunePathClass, otherPathClass, stromaPathClass, tumorPathClass];

getDetectionObjects().forEach( detection -> {

    if (detection.getPathClass() == immunePathClass.pathClass){
        immunePathClass.count++;
        immunePathClass.area += detection.getROI().getArea();
    } else if (detection.getPathClass() == otherPathClass.pathClass) {
        otherPathClass.count++;
        otherPathClass.area += detection.getROI().getArea();        
    } else if (detection.getPathClass() == stromaPathClass.pathClass) {
        stromaPathClass.count++;
        stromaPathClass.area += detection.getROI().getArea();  
    } else {
        tumorPathClass.count++;
        tumorPathClass.area += detection.getROI().getArea();  
    }

});

PathObject rootObject = hierarchy.getRootObject();
def measurementList = rootObject.getMeasurementList();
pathClassList.forEach( pathClassMap -> {
    measurementList.put(pathClassMap.pathClass.getName() + " total area px", pathClassMap.area);
    measurementList.put(pathClassMap.pathClass.getName() + " total area µm^2", pathClassMap.area*pixelSize*pixelSize);
    measurementList.put(pathClassMap.pathClass.getName() + " total area %", pathClassMap.area/roiAnnotationArea*100);
});
measurementList.put("Total ROI area px", roiAnnotationArea);
measurementList.put("Total ROI area µm^2", roiAnnotationArea*pixelSize*pixelSize);

try {
    measurementList.put("Total eTILs %",(double)immunePathClass.count/(tumorPathClass.count + immunePathClass.count)*100);
} catch (ArithmeticException ae){
    println("ERROR ADDING Total eTILs % " + ae);
}
try {
    measurementList.put("Total etTILs %", (double)immunePathClass.count/(immunePathClass.count + tumorPathClass.count + stromaPathClass.count + otherPathClass.count)*100);
} catch (ArithmeticException ae){
    println("ERROR ADDING Total etTILs % " + ae);
}
try {
    measurementList.put("Total esTILs %", (double)immunePathClass.count/(immunePathClass.count + stromaPathClass.count + otherPathClass.count)*100);
} catch (ArithmeticException ae){
    println("ERROR ADDING Total esTILs % " + ae);
}
try {
    measurementList.put("Total eaTILs mm^2", (double)immunePathClass.count/(roiAnnotationArea*pixelSize*pixelSize)*1000*1000);
} catch (ArithmeticException ae){
    println("ERROR ADDING Total eaTILs mm^2 " + ae);
}
try {
    measurementList.put("Total easTILs %", (double)immunePathClass.area/(roiAnnotationArea - tumorPathClass.area)*100);
} catch (ArithmeticException ae){
    println("ERROR ADDING Total easTILs % " + ae);
}

println("Done");


