static PathObject subtractAnnotations(PathObject minuend, PathObject subtrahend) {

    if (minuend == null || subtrahend == null) {
       return minuend; 
    }
   
    def minuendRoi = minuend.getROI();
    def subtrahendRoi = subtrahend.getROI();
    def subtractedRoi = RoiTools.subtract(minuendRoi, subtrahendRoi);

    if (subtractedRoi.getArea() > 0) {
        PathObject subtractedAnnotation  = PathObjects.createAnnotationObject(subtractedRoi);
        addObject(subtractedAnnotation);
        removeObject(minuend, false);

        return subtractedAnnotation;
    } else {
        removeObject(minuend, false);

        return null;
    }
    
}


